import{_ as t}from"./plugin-vue_export-helper-c27b6911.js";import{o,c as e,a as r}from"./app-716fac87.js";const n={},s=r('<h1 id="http-请求状态码" tabindex="-1"><a class="header-anchor" href="#http-请求状态码" aria-hidden="true">#</a> http 请求状态码</h1><p>当涉及到HTTP状态码时，以下是一些常见且重要的状态枚举以及它们的附加说明：</p><ol><li><p><strong>OK (200)</strong>：表示请求已成功处理，服务器返回所请求的数据。这通常是一个成功的响应状态码。</p></li><li><p><strong>BadRequest (400)</strong>：表示服务器无法理解客户端的请求，通常是因为请求参数格式错误或无效。</p></li><li><p><strong>Unauthorized (401)</strong>：表示客户端未经身份验证或身份验证失败。需要提供有效的身份验证凭据。</p></li><li><p><strong>Forbidden (403)</strong>：表示客户端没有访问所请求资源的权限。服务器理解请求，但拒绝提供响应。</p></li><li><p><strong>NotFound (404)</strong>：表示请求的资源不存在。服务器未找到与请求URI相对应的资源。</p></li><li><p><strong>InternalServerError (500)</strong>：表示服务器在处理请求时发生了内部错误。这可能是服务器代码错误或配置问题。</p></li><li><p><strong>ServiceUnavailable (503)</strong>：表示服务器暂时无法处理请求，通常是由于服务器过载或维护。</p></li><li><p><strong>GatewayTimeout (504)</strong>：表示服务器作为网关或代理，未能及时从上游服务器收到响应。这可能是上游服务器延迟引起的。</p></li><li><p><strong>NotModified (304)</strong>：表示客户端请求的资源未发生更改，服务器返回此状态码以节省带宽。</p></li><li><p><strong>Redirect (3xx)</strong>：这是一系列重定向状态码，如 <code>MovedPermanently (301)</code> 表示请求的资源已永久移动到新位置，客户端应更新书签等信息。</p></li><li><p><strong>MethodNotAllowed (405)</strong>：表示请求方法（例如GET、POST等）不适用于请求的资源。例如，尝试对只允许GET请求的资源使用POST方法。</p></li><li><p><strong>TooManyRequests (429)</strong>：表示客户端已经发送过多的请求到服务器，服务器因此拒绝处理。这通常用于限制客户端的请求频率。</p></li><li><p><strong>UnsupportedMediaType (415)</strong>：表示服务器无法处理请求的媒体类型。例如，客户端发送的数据格式不受支持。</p></li><li><p><strong>PreconditionFailed (412)</strong>：表示请求头中指定的前提条件失败。例如，客户端使用条件请求时，资源的状态与客户端预期不符合。</p></li><li><p><strong>Created (201)</strong>：表示服务器成功地创建了新资源，并将其URI返回给客户端。通常用于POST请求。</p></li></ol><p>这些是HTTP状态码中一些常见和重要的枚举值及其说明。理解这些状态码可以帮助开发人员更好地诊断和处理与Web服务交互时可能出现的问题。不同的状态码传达了不同的信息，帮助客户端和服务器之间进行有效的通信。</p>',4),i=[s];function l(p,a){return o(),e("div",null,i)}const c=t(n,[["render",l],["__file","ResponseStatus.html.vue"]]);export{c as default};
